import { React, useState, useEffect } from "react";
import "./Board.css";
import PostBox from "./postBox";
//import axios from "axios";

const PostList = ({ postList }) => {
  return (
    <div>
      {postList.map((post) => (
        <PostBox postList={post} />
      ))}
    </div>
  );
};
export default PostList;
